import { Route, Routes, useResolvedPath } from "react-router-dom";
import RouterInfo, { RouterItem } from "./RouterInfo";
import PrivateRoute from "./PrivateRouter";
import { useState } from "react";

const RoutesObject = (): JSX.Element => {
  const [hasNav, setHasNav] = useState<boolean>(true);

  const handleNavOnUpdate = (isWithNav: boolean) => {
    setHasNav(isWithNav);
  };

  return (
    <Routes>
      {Object.entries(RouterInfo).map(([key, item]: [string, RouterItem]) => {
        return (
          <Route
            key={item.path}
            path={item.path}
            element={
              item.isLoggedIn ? (
                <PrivateRoute>{item.element}</PrivateRoute>
              ) : (
                <>{item.element}</>
              )
            }
            children={() => handleNavOnUpdate(item.isWithNav)}
          />
        );
      })}
    </Routes>
  );
};

export default RoutesObject;
